6# Como nem sempre a pessoa verbaliza a vontade de morrer, há outros sinais que podem traduzir essa intenção:
- Ausência /abandono de planos futuros;
- Isolar-se;
- Grandes mudanças de humor;
- Ter atitudes arriscadas;
- Dar algo de muito valor para alguém que ela goste muito.

“El suicida

Su boca blanca
llama a la nieve de la muerte;
su corazón encadenado
se entrega el ángel negro de su pecho
que lo devora.”

Clara Janés
